    <title>김건우에 대해</title>
</head>
<body>
    수능 아직안봄<br>
    고등학교 강서고<br>
    졸업 아직안함<br>
    머리 병신<br>
    몸 병신<br>
    얼굴 병신<br>
    할 수 있는거 없음<br>
    친구 많이 없음<br>
